    useEffect(()=>{fetchSkill();} , [skills]);

    const fetchSkill = ()=> {
        console.log('hol');
        console.log("ha");
        axios
            .get('http://localhost:5000/competences/')
            .then(res => {console.log(res)})
            .catch(error => {console.log(error)});
            
            (res) => {setSkills(res);}
            return ( 
                console.log("helllo")
            );
            
            }}

